const videos = [
    {
        name: 'Обезьянья возня',
        duration: 15,
    },
    {
        name: 'Gorillas',
        duration: 15,
    },
    {
        name: 'Banana farm',
        duration: 15,
    }
]


export function VideoList() {
    return (
        <>
        <h1>Video List</h1>
        {
            videos.map((video) => {
                return (
                    <div>
                        <p>{video.name}</p>
                        <p>{video.duration}</p>
                        <button>Нраица</button>
                    </div>
                )
            })
        }
        </>
    )
}
